import seedLib from "@/libs1/seed";
export default {
  data() {
    return {
      seedWord: []
    };
  },
  created() {
    const localInfo = window.localStorage["encryptSeed"];
    if (this.$store.state.password && localInfo) {
      let userInfo = localInfo;
      try {
        this.seedWord = seedLib
          .decryptSeedPhrase(
            JSON.parse(
              seedLib.decryptSeedPhrase(userInfo, this.$store.state.password)
            ).encrSeed,
            this.$store.state.password
          )
          .split(" ");
      } catch (err) {
        this.seedWord = "null";
      }
    }
  }
};
